class Shift {
  constructor(name, time, shift, remark) {
    this.name = name;
    this.time = time;
    this.shift = shift;
    this.remark = remark;
  }
}

export function getDayhift(list, name) {
  let oneDayShift = list.filter((value) => {
    if (value.name == name) {
      return value;
    }
  })
  return oneDayShift;
}

